import React from "react";
import { Outlet, useSearchParams } from "react-router-dom";

const Users = () => {
  const [searchparam, setSearchParam] = useSearchParams();
  const showActiveUsers = searchparam.get("filter") === "active";
  const age = searchparam.get("age");
  const city = searchparam.get("city");
  console.log(age);
  console.log(city);
  return (
    <>
      <div>
        <h2>User 1</h2>
        <h2>User 2</h2>
        <h2>User 3</h2>
        <Outlet />
        <p>{age}</p>
        <p>{city}</p>
        <div>
          <button
            onClick={() => {
              setSearchParam({ filter: "active" });
            }}
          >
            Active user
          </button>
          <button
            onClick={() => {
              setSearchParam({});
            }}
          >
            Reset Filter
          </button>
        </div>
        {showActiveUsers ? <h2>Active users Show</h2> : <h2>Show all user</h2>}
      </div>
    </>
  );
};

export default Users;
